import "./App.css";
import React from "react";

function Guvi() {
  return (
    <div>
      <h1>Welcome to Guvi</h1>
      <img src="https://images.pexels.com/photos/4164418/pexels-photo-4164418.jpeg" style={{width: 150, height: 150, borderRadius: '50%'}} alt="logo" />
    </div>
  )
}

function App() {
  return (
    <div className="container">
      <Guvi />
    </div>
  );
}

export default App;
